import React from "react";
import '../styles/dash.css'
import { Link } from "react-router-dom";


/*Importaciones de imagenes*/
// import diseno from '../img/Untitled.png';
// import graficoimg from '../img/countries.png';
import grupo from '../images/grupo.png'

/*Desde aqui comienza el sitio web*/
function Dash() {

    return (
       
<>

<body>
    
<header class="cabecera">
            <div class="listado">
                
            {/* <img class="icono1" src={diseno} alt="Usuarios" /> */}
            <h5 class="sec">Secciónes</h5>
            <div class="cartas">
    <div class="carta">
        <h2 class="carta-titulo">Usuarios</h2>
        <img className="grupo" src={grupo} alt="" />
        <p class="carta-descripcion">Aquí puedes editar, eliminar o crear usuarios.</p>
    </div>
    <div class="carta">
        <h2 class="carta-titulo">Canciones</h2>
        <p class="carta-descripcion">Aquí puedes editar, eliminar o crear canciones.</p>
    </div>
    <div class="carta">
        <h2 class="carta-titulo">Álbumes</h2>
        <p class="carta-descripcion">Aquí puedes editar, eliminar o crear álbumes.</p>
    </div>
</div>

            </div>
        </header>
            
            <div className="muestra">
            {/* <img class="img1" src={graficoimg} alt="Grafico" /> */}
            </div> 
            

    
</body>


        </>



    )


}

export default Dash;
